Two goals:
(1) To support double quoted nodes in any level , e.g., root."s.g"."device.1"."sensor.1" : root -> "s.g" -> "device.1" -> "sensor.1"
(2) In antlr, a path has already been split to nodes. For example, root.sg1.d1.s1 to [root, sg1, d1, s1]. Its no need to generate a Path and split again in metadata, so this PR's goal is to reduce split actions in the metadata.

Here is the benchmark program.

```java
package org.apache.iotdb.db.integration;

import java.io.IOException;
import java.sql.Connection;
import java.sql.DriverManager;
import java.sql.ResultSet;
import java.sql.ResultSetMetaData;
import java.sql.SQLException;
import java.sql.Statement;
import java.util.concurrent.TimeUnit;
import org.apache.iotdb.db.exception.StorageEngineException;
import org.apache.iotdb.db.utils.EnvironmentUtils;
import org.apache.iotdb.jdbc.IoTDBSQLException;
import org.junit.Test;
import org.openjdk.jmh.annotations.Benchmark;
import org.openjdk.jmh.annotations.BenchmarkMode;
import org.openjdk.jmh.annotations.Mode;
import org.openjdk.jmh.annotations.OutputTimeUnit;
import org.openjdk.jmh.annotations.Scope;
import org.openjdk.jmh.annotations.State;
import org.openjdk.jmh.runner.Runner;
import org.openjdk.jmh.runner.RunnerException;
import org.openjdk.jmh.runner.options.Options;
import org.openjdk.jmh.runner.options.OptionsBuilder;

@State(Scope.Thread)
@BenchmarkMode(Mode.AverageTime)
@OutputTimeUnit(TimeUnit.MICROSECONDS)

public class IoTDBBenchMark {

  @Benchmark
  public void hello()
      throws ClassNotFoundException, SQLException, IOException, StorageEngineException {
    EnvironmentUtils.closeStatMonitor();
    EnvironmentUtils.envSetUp();
    Class.forName("org.apache.iotdb.jdbc.IoTDBDriver");
    try (Connection connection = DriverManager.getConnection("jdbc:iotdb://127.0.0.1:6667/", "root", "root");
        Statement statement = connection.createStatement()) {
      try {
        statement.execute("SET STORAGE GROUP TO root.hello.world.boris.jack.lucy.trump.clinton.good.sg1");
        statement.execute(
            "CREATE TIMESERIES root.hello.world.boris.jack.lucy.trump.clinton.good.sg1.d1.s1 WITH DATATYPE=INT64, ENCODING=RLE, COMPRESSOR=SNAPPY");
        statement.execute(
            "CREATE TIMESERIES root.hello.world.boris.jack.lucy.trump.clinton.good.sg1.d1.s2 WITH DATATYPE=INT64, ENCODING=RLE, COMPRESSOR=SNAPPY");
        statement.execute(
            "CREATE TIMESERIES root.hello.world.boris.jack.lucy.trump.clinton.good.sg1.d1.s3 WITH DATATYPE=INT64, ENCODING=RLE, COMPRESSOR=SNAPPY");
      } catch (IoTDBSQLException e) {
        System.out.println(e.getMessage());
      }

      for (int i = 0; i <= 100000; i++) {
        statement.addBatch("insert into root.hello.world.boris.jack.lucy.trump.clinton.good.sg1.d1(timestamp, s1, s2, s3) values("+ i + "," + 1 + "," + 1 + "," + 1 + ")");
      }
      statement.executeBatch();
      statement.clearBatch();

      ResultSet resultSet = statement.executeQuery("select * from root where time <= 10");
      if (resultSet != null) {
        System.out.println("--------------------------");
        final ResultSetMetaData metaData = resultSet.getMetaData();
        final int columnCount = metaData.getColumnCount();
        for (int i = 0; i < columnCount; i++) {
          System.out.print(metaData.getColumnLabel(i + 1) + " ");
        }
        System.out.println();
        while (resultSet.next()) {
          for (int i = 1; ; i++) {
            System.out.print(resultSet.getString(i));
            if (i < columnCount) {
              System.out.print(", ");
            } else {
              System.out.println();
              break;
            }
          }
        }
        System.out.println("--------------------------\n");
      }
    }
    EnvironmentUtils.cleanEnv();
  }



  @Test
  public void run() throws RunnerException {
    Options opt = new OptionsBuilder()
        .include(IoTDBBenchMark.class.getSimpleName())
        .forks(1)
        .warmupIterations(10)
        .measurementIterations(10)
        .build();
    new Runner(opt).run();
  }

}
